import React from 'react';
import { useLocation } from 'react-router-dom'
import './Header.css';
import { BsFillPeopleFill , BsFillCollectionPlayFill } from "react-icons/bs";

export default function Header() {

  let location = useLocation();
  let url = location.pathname;

  if(location.pathname.startsWith('/livestorm-test/?')) {
    return null;
  } else {
    alert({url});
    return (

      <div className='nav-bar'><div className='nav-buttons'>
      <a className='router-button' href='./'><BsFillPeopleFill size='30' style={{margin:'12px'}} /> </a>
      <a className='router-button' href='./library'><BsFillCollectionPlayFill size='30' style={{margin:'12px'}} /></a>
      </div></div>
        );
    }


}
